} let isSpent = await instance.isSpent(toHex(input.nullifierHash))
assert.isFalse(isSpent) const { proof,
} = await genProofAndPublicSignals( input, 'prod/vote.circom', 'build/vote.zkey', 'circuits/vote.wasm'
